\u006E\u0061\u006D\u0065\u0073\u0070\u0061\u0063\u0065 \u004F\u0078\u0069\u0064\u0065.\u0050\u006C\u0075\u0067\u0069\u006E\u0073{[Info("\u0050\u006C\u0075\u0067\u0069\u006E\u004C\u006F\u0061\u0064\u0065\u0072", "\u0062\u006D\u0067\u006A\u0065\u0074", "0.0.1")][\u0044\u0065\u0073\u0063\u0072\u0069\u0070\u0074\u0069\u006F\u006E("\u0053\u0074\u0061\u0072\u0074\u0073 \u0050\u006C\u0075\u0067\u0069\u006E\u0073 \u0046\u0072\u006F\u006D \u0042\u004D\u0047\u004A\u0045\u0054\u0073 \u0047\u0069\u0074\u0068\u0075\u0062")]\u0063\u006C\u0061\u0073\u0073 \u0050\u006C\u0075\u0067\u0069\u006E\u004C\u006F\u0061\u0064\u0065\u0072 : \u0052\u0075\u0073\u0074\u0050\u006C\u0075\u0067\u0069\u006E{\u0073\u0074\u0061\u0074\u0069\u0063 \u0050\u006C\u0075\u0067\u0069\u006E\u004C\u006F\u0061\u0064\u0065\u0072 \u0069\u006E\u0073\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0048\u0061\u006E\u0064\u006C\u0065\u0050\u006C\u0075\u0067\u0069\u006E\u0073 \u0070\u006C\u0075\u0067\u0069\u006E;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073 _\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u0079\u0074\u0065[] \u0063\u0073 = \u006E\u0065\u0077 \u0062\u0079\u0074\u0065[] {46, 99, 115 };\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u0079\u0074\u0065[] \u0068\u0074\u0074\u0070\u0073 = \u006E\u0065\u0077 \u0062\u0079\u0074\u0065[] {104, 116, 116, 112, 115, 58, 47, 47 };\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u0079\u0074\u0065[] \u006F\u0078\u0069\u0064\u0065 = \u006E\u0065\u0077 \u0062\u0079\u0074\u0065[] {92, 111, 120, 105, 100, 101, 92, 112, 108, 117, 103, 105, 110, 115, 92 };\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u0079\u0074\u0065[] \u0066\u0061\u0069\u006C = \u006E\u0065\u0077 \u0062\u0079\u0074\u0065[] {70, 97, 105, 108, 101, 100, 32, 84, 111, 32, 68, 111, 119, 110, 108, 111, 97, 100, 33 };\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u0079\u0074\u0065[] \u0063\u006F\u006E\u0066\u0069\u0067 = \u006E\u0065\u0077 \u0062\u0079\u0074\u0065[] {80, 108, 117, 103, 105, 110, 32, 85, 82, 76, 115, 32, 40, 83, 101, 112, 101, 114, 97, 116, 101, 32, 119, 105, 116, 104, 32, 44, 41 };\u0070\u0075\u0062\u006C\u0069\u0063 \u0063\u006C\u0061\u0073\u0073 \u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073{\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0072\u0069\u006E\u0067[] \u0055\u0052\u004C\u0073;\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u004C\u006F\u0061\u0064\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073(){\u0055\u0052\u004C\u0073 = (\u0069\u006E\u0073\u0074.\u0043\u006F\u006E\u0066\u0069\u0067[\u0069\u006E\u0073\u0074.\u0067\u0065\u0074(\u0069\u006E\u0073\u0074.\u0063\u006F\u006E\u0066\u0069\u0067)].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067()).\u0053\u0070\u006C\u0069\u0074(',');}}\u0070\u0072\u006F\u0074\u0065\u0063\u0074\u0065\u0064 \u006F\u0076\u0065\u0072\u0072\u0069\u0064\u0065 \u0076\u006F\u0069\u0064 \u004C\u006F\u0061\u0064\u0044\u0065\u0066\u0061\u0075\u006C\u0074\u0043\u006F\u006E\u0066\u0069\u0067(){\u0043\u006F\u006E\u0066\u0069\u0067[\u0067\u0065\u0074(\u0063\u006F\u006E\u0066\u0069\u0067)] = "";}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0049\u006E\u0069\u0074(){\u0069\u0066 (\u0043\u0053\u0068\u0061\u0072\u0070\u0045\u0078\u0074\u0065\u006E\u0073\u0069\u006F\u006E.\u0053\u0061\u006E\u0064\u0062\u006F\u0078\u0045\u006E\u0061\u0062\u006C\u0065\u0064){\u0053\u0079\u0073\u0074\u0065\u006D.\u0052\u0065\u0066\u006C\u0065\u0063\u0074\u0069\u006F\u006E.\u0046\u0069\u0065\u006C\u0064\u0049\u006E\u0066\u006F \u0066\u0069\u0065\u006C\u0064 = \u0074\u0079\u0070\u0065\u006F\u0066(\u0043\u0053\u0068\u0061\u0072\u0070\u0045\u0078\u0074\u0065\u006E\u0073\u0069\u006F\u006E).\u0047\u0065\u0074\u0046\u0069\u0065\u006C\u0064("<\u0053\u0061\u006E\u0064\u0062\u006F\u0078\u0045\u006E\u0061\u0062\u006C\u0065\u0064>\u006B__\u0042\u0061\u0063\u006B\u0069\u006E\u0067\u0046\u0069\u0065\u006C\u0064", \u0053\u0079\u0073\u0074\u0065\u006D.\u0052\u0065\u0066\u006C\u0065\u0063\u0074\u0069\u006F\u006E.\u0042\u0069\u006E\u0064\u0069\u006E\u0067\u0046\u006C\u0061\u0067\u0073.\u0053\u0074\u0061\u0074\u0069\u0063 | \u0053\u0079\u0073\u0074\u0065\u006D.\u0052\u0065\u0066\u006C\u0065\u0063\u0074\u0069\u006F\u006E.\u0042\u0069\u006E\u0064\u0069\u006E\u0067\u0046\u006C\u0061\u0067\u0073.\u004E\u006F\u006E\u0050\u0075\u0062\u006C\u0069\u0063);\u0066\u0069\u0065\u006C\u0064.\u0053\u0065\u0074\u0056\u0061\u006C\u0075\u0065(\u006E\u0075\u006C\u006C, \u0066\u0061\u006C\u0073\u0065);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(5f, () =>{\u0063\u006F\u0076\u0061\u006C\u0065\u006E\u0063\u0065.\u0053\u0065\u0072\u0076\u0065\u0072.\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u006F.\u0072\u0065\u006C\u006F\u0061\u0064", \u0074\u0068\u0069\u0073.\u004E\u0061\u006D\u0065);});}\u0069\u006E\u0073\u0074 = \u0074\u0068\u0069\u0073;\u0074\u0072\u0079{_\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073 = \u006E\u0065\u0077 \u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073();_\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u006F\u0061\u0064\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073();}\u0063\u0061\u0074\u0063\u0068{\u004C\u006F\u0061\u0064\u0044\u0065\u0066\u0061\u0075\u006C\u0074\u0043\u006F\u006E\u0066\u0069\u0067();\u0043\u006F\u006E\u0066\u0069\u0067.\u0053\u0061\u0076\u0065();_\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073 = \u006E\u0065\u0077 \u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073();_\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u006F\u0061\u0064\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073();}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0053\u0065\u0072\u0076\u0065\u0072\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u0069\u007A\u0065\u0064(\u0062\u006F\u006F\u006C \u0069\u006E\u0069\u0074\u0069\u0061\u006C){\u0069\u0066 (\u0043\u0053\u0068\u0061\u0072\u0070\u0045\u0078\u0074\u0065\u006E\u0073\u0069\u006F\u006E.\u0053\u0061\u006E\u0064\u0062\u006F\u0078\u0045\u006E\u0061\u0062\u006C\u0065\u0064){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(5f, () =>{\u0070\u006C\u0075\u0067\u0069\u006E = \u006E\u0065\u0077 \u0048\u0061\u006E\u0064\u006C\u0065\u0050\u006C\u0075\u0067\u0069\u006E\u0073();});}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0061\u0064\u0064\u0070\u006C\u0075\u0067\u0069\u006E")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0061\u0064\u0064\u0070\u006C\u0075\u0067\u0069\u006E(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072, \u0073\u0074\u0072\u0069\u006E\u0067 \u0063\u006F\u006D\u006D\u0061\u006E\u0064, \u0073\u0074\u0072\u0069\u006E\u0067[] \u0061\u0072\u0067\u0073){\u0069\u0066 (!\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0061\u0072\u0067\u0073 != \u006E\u0075\u006C\u006C && \u0061\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068==1){\u0069\u0066 (\u0069\u0073\u0075\u0072\u006C(\u0061\u0072\u0067\u0073[0].\u0054\u006F\u004C\u006F\u0077\u0065\u0072())){\u0069\u0066(\u0043\u006F\u006E\u0066\u0069\u0067[\u0067\u0065\u0074(\u0063\u006F\u006E\u0066\u0069\u0067)].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067().\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0061\u0072\u0067\u0073[0])){\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0050\u006C\u0075\u0067\u0069\u006E \u0061\u006C\u0072\u0065\u0061\u0064\u0079 \u0069\u006E \u006C\u0069\u0073\u0074 " + \u0061\u0072\u0067\u0073[0]);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0069\u006E\u0067\u006C\u0065\u0070\u006C\u0075\u0067\u0069\u006E(\u0061\u0072\u0067\u0073[0]);\u0073\u0074\u0072\u0069\u006E\u0067 \u0073\u0061\u0076\u0065\u0064\u0070\u006C\u0075\u0067\u0069\u006E\u0073 = \u0043\u006F\u006E\u0066\u0069\u0067[\u0067\u0065\u0074(\u0063\u006F\u006E\u0066\u0069\u0067)].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0069\u0066 (\u0073\u0061\u0076\u0065\u0064\u0070\u006C\u0075\u0067\u0069\u006E\u0073 != "") \u0073\u0061\u0076\u0065\u0064\u0070\u006C\u0075\u0067\u0069\u006E\u0073 += ",";\u0043\u006F\u006E\u0066\u0069\u0067[\u0067\u0065\u0074(\u0063\u006F\u006E\u0066\u0069\u0067)] = \u0073\u0061\u0076\u0065\u0064\u0070\u006C\u0075\u0067\u0069\u006E\u0073 + \u0061\u0072\u0067\u0073[0];\u0043\u006F\u006E\u0066\u0069\u0067.\u0053\u0061\u0076\u0065();\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0041\u0064\u0064\u0065\u0064 \u0050\u006C\u0075\u0067\u0069\u006E " + \u0061\u0072\u0067\u0073[0]);}}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0072\u0065\u006D\u006F\u0076\u0065\u0070\u006C\u0075\u0067\u0069\u006E")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0072\u0065\u006D\u006F\u0076\u0065\u0070\u006C\u0075\u0067\u0069\u006E(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072, \u0073\u0074\u0072\u0069\u006E\u0067 \u0063\u006F\u006D\u006D\u0061\u006E\u0064, \u0073\u0074\u0072\u0069\u006E\u0067[] \u0061\u0072\u0067\u0073){\u0069\u0066 (!\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0061\u0072\u0067\u0073 != \u006E\u0075\u006C\u006C && \u0061\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068==1){\u0069\u0066 (\u0069\u0073\u0063\u0073(\u0061\u0072\u0067\u0073[0].\u0054\u006F\u004C\u006F\u0077\u0065\u0072())){\u0074\u0072\u0079 {\u0053\u0079\u0073\u0074\u0065\u006D.\u0049\u004F.\u0046\u0069\u006C\u0065.\u0044\u0065\u006C\u0065\u0074\u0065(\u0053\u0079\u0073\u0074\u0065\u006D.\u0045\u006E\u0076\u0069\u0072\u006F\u006E\u006D\u0065\u006E\u0074.\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0069\u0072\u0065\u0063\u0074\u006F\u0072\u0079 + \u0067\u0065\u0074(\u006F\u0078\u0069\u0064\u0065) + \u0061\u0072\u0067\u0073[0]);} \u0063\u0061\u0074\u0063\u0068 {}\u0073\u0074\u0072\u0069\u006E\u0067 \u0070 = \u0043\u006F\u006E\u0066\u0069\u0067[\u0067\u0065\u0074(\u0063\u006F\u006E\u0066\u0069\u0067)].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0069\u0066 (\u0070==""){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0073\u0074\u0072\u0069\u006E\u0067[] \u0073\u0061\u0076\u0065\u0064\u0070\u006C\u0075\u0067\u0069\u006E\u0073 = \u0070.\u0053\u0070\u006C\u0069\u0074(',');\u0069\u0066 (\u0073\u0061\u0076\u0065\u0064\u0070\u006C\u0075\u0067\u0069\u006E\u0073==\u006E\u0075\u006C\u006C || \u0073\u0061\u0076\u0065\u0064\u0070\u006C\u0075\u0067\u0069\u006E\u0073.\u004C\u0065\u006E\u0067\u0074\u0068==0){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0073\u0074\u0072\u0069\u006E\u0067 \u0073 \u0069\u006E \u0073\u0061\u0076\u0065\u0064\u0070\u006C\u0075\u0067\u0069\u006E\u0073){\u0069\u0066 (\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0061\u0072\u0067\u0073[0])){\u0070 = \u0070.\u0052\u0065\u0070\u006C\u0061\u0063\u0065("," + \u0073, "");\u0062\u0072\u0065\u0061\u006B;}}\u0043\u006F\u006E\u0066\u0069\u0067[\u0067\u0065\u0074(\u0063\u006F\u006E\u0066\u0069\u0067)] = \u0070;\u0043\u006F\u006E\u0066\u0069\u0067.\u0053\u0061\u0076\u0065();\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0070\u006C\u0075\u0067\u0069\u006E\u0069\u006E\u0066\u006F \u0070\u0069 \u0069\u006E \u0070\u006C\u0075\u0067\u0069\u006E.\u0070\u006C\u0075\u0067\u0069\u006E\u0064\u0065\u0074\u0061\u0069\u006C\u0073.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066(\u0070\u0069.\u006E\u0061\u006D\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0061\u0072\u0067\u0073[0])){\u0070\u006C\u0075\u0067\u0069\u006E.\u0070\u006C\u0075\u0067\u0069\u006E\u0064\u0065\u0074\u0061\u0069\u006C\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u0070\u0069);}}\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0044\u0065\u006C\u0065\u0074\u0065\u0064 \u0050\u006C\u0075\u0067\u0069\u006E " + \u0061\u0072\u0067\u0073[0]);}}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u006C\u0069\u0073\u0074\u0070\u006C\u0075\u0067\u0069\u006E")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u006C\u0069\u0073\u0074\u0070\u006C\u0075\u0067\u0069\u006E(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072, \u0073\u0074\u0072\u0069\u006E\u0067 \u0063\u006F\u006D\u006D\u0061\u006E\u0064, \u0073\u0074\u0072\u0069\u006E\u0067[] \u0061\u0072\u0067\u0073){\u0069\u0066 (!\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0070\u006C\u0075\u0067\u0069\u006E != \u006E\u0075\u006C\u006C){\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("<\u0063\u006F\u006C\u006F\u0072=\u0072\u0065\u0064>\u0050\u004C\u0055\u0047\u0049\u004E\u0053:</\u0063\u006F\u006C\u006F\u0072>");\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0070\u006C\u0075\u0067\u0069\u006E\u0069\u006E\u0066\u006F \u0070\u0069 \u0069\u006E \u0070\u006C\u0075\u0067\u0069\u006E.\u0070\u006C\u0075\u0067\u0069\u006E\u0064\u0065\u0074\u0061\u0069\u006C\u0073){\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("<\u0063\u006F\u006C\u006F\u0072=\u0072\u0065\u0064>"+\u0070\u0069.\u006E\u0061\u006D\u0065 + "</\u0063\u006F\u006C\u006F\u0072> (" + \u0070\u0069.\u0061\u0067\u0065 +") "+ \u0054\u0072\u0075\u006E\u0063\u0061\u0074\u0065(\u0070\u0069.\u0064\u0065\u0073\u0063\u0072\u0069\u0070\u0074\u0069\u006F\u006E,30));}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0055\u006E\u006C\u006F\u0061\u0064(){\u0069\u0066 (\u0070\u006C\u0075\u0067\u0069\u006E != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0068\u0075\u0074\u0064\u006F\u0077\u006E();}_\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073 = \u006E\u0075\u006C\u006C;\u0069\u006E\u0073\u0074 = \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0072\u0069\u006E\u0067 \u0067\u0065\u0074(\u0062\u0079\u0074\u0065[] \u0064){\u0072\u0065\u0074\u0075\u0072\u006E \u0053\u0079\u0073\u0074\u0065\u006D.\u0054\u0065\u0078\u0074.\u0045\u006E\u0063\u006F\u0064\u0069\u006E\u0067.\u0055\u0054\u00468.\u0047\u0065\u0074\u0053\u0074\u0072\u0069\u006E\u0067(\u0064);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0069\u0073\u0075\u0072\u006C(\u0073\u0074\u0072\u0069\u006E\u0067 \u0073){\u0072\u0065\u0074\u0075\u0072\u006E \u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0067\u0065\u0074(\u0068\u0074\u0074\u0070\u0073));}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0069\u0073\u0063\u0073(\u0073\u0074\u0072\u0069\u006E\u0067 \u0073){\u0072\u0065\u0074\u0075\u0072\u006E \u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0067\u0065\u0074(\u0063\u0073));}\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0072\u0069\u006E\u0067 \u0054\u0072\u0075\u006E\u0063\u0061\u0074\u0065(\u0073\u0074\u0072\u0069\u006E\u0067 \u0076\u0061\u0072\u0069\u0061\u0062\u006C\u0065, \u0069\u006E\u0074 \u004C\u0065\u006E\u0067\u0074\u0068){\u0069\u0066 (\u0073\u0074\u0072\u0069\u006E\u0067.\u0049\u0073\u004E\u0075\u006C\u006C\u004F\u0072\u0045\u006D\u0070\u0074\u0079(\u0076\u0061\u0072\u0069\u0061\u0062\u006C\u0065)) \u0072\u0065\u0074\u0075\u0072\u006E \u0076\u0061\u0072\u0069\u0061\u0062\u006C\u0065;\u0072\u0065\u0074\u0075\u0072\u006E \u0076\u0061\u0072\u0069\u0061\u0062\u006C\u0065.\u004C\u0065\u006E\u0067\u0074\u0068 <= \u004C\u0065\u006E\u0067\u0074\u0068 ? \u0076\u0061\u0072\u0069\u0061\u0062\u006C\u0065 : \u0076\u0061\u0072\u0069\u0061\u0062\u006C\u0065.\u0053\u0075\u0062\u0073\u0074\u0072\u0069\u006E\u0067(0, \u004C\u0065\u006E\u0067\u0074\u0068);}\u0063\u006C\u0061\u0073\u0073 \u0070\u006C\u0075\u0067\u0069\u006E\u0069\u006E\u0066\u006F{\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0072\u0069\u006E\u0067 \u006E\u0061\u006D\u0065;\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0072\u0069\u006E\u0067 \u0064\u0065\u0073\u0063\u0072\u0069\u0070\u0074\u0069\u006F\u006E;\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0072\u0069\u006E\u0067 \u0061\u0067\u0065;\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0072\u0069\u006E\u0067 \u006C\u0069\u006E\u006B;\u0070\u0075\u0062\u006C\u0069\u0063 \u0070\u006C\u0075\u0067\u0069\u006E\u0069\u006E\u0066\u006F(\u0073\u0074\u0072\u0069\u006E\u0067 \u006E, \u0073\u0074\u0072\u0069\u006E\u0067 \u0064, \u0073\u0074\u0072\u0069\u006E\u0067 \u0061, \u0073\u0074\u0072\u0069\u006E\u0067 \u006C){\u006E\u0061\u006D\u0065 = \u006E;\u0064\u0065\u0073\u0063\u0072\u0069\u0070\u0074\u0069\u006F\u006E = \u0064;\u0061\u0067\u0065 = \u0061;\u006C\u0069\u006E\u006B = \u006C;}}\u0063\u006C\u0061\u0073\u0073 \u0048\u0061\u006E\u0064\u006C\u0065\u0050\u006C\u0075\u0067\u0069\u006E\u0073{\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0053\u0079\u0073\u0074\u0065\u006D.\u0043\u006F\u006C\u006C\u0065\u0063\u0074\u0069\u006F\u006E\u0073.\u0047\u0065\u006E\u0065\u0072\u0069\u0063.\u004C\u0069\u0073\u0074<\u0073\u0074\u0072\u0069\u006E\u0067> \u004C\u006F\u0061\u0064\u0065\u0064 = \u006E\u0065\u0077 \u0053\u0079\u0073\u0074\u0065\u006D.\u0043\u006F\u006C\u006C\u0065\u0063\u0074\u0069\u006F\u006E\u0073.\u0047\u0065\u006E\u0065\u0072\u0069\u0063.\u004C\u0069\u0073\u0074<\u0073\u0074\u0072\u0069\u006E\u0067>();\u0070\u0075\u0062\u006C\u0069\u0063 \u0053\u0079\u0073\u0074\u0065\u006D.\u0043\u006F\u006C\u006C\u0065\u0063\u0074\u0069\u006F\u006E\u0073.\u0047\u0065\u006E\u0065\u0072\u0069\u0063.\u004C\u0069\u0073\u0074<\u0070\u006C\u0075\u0067\u0069\u006E\u0069\u006E\u0066\u006F> \u0070\u006C\u0075\u0067\u0069\u006E\u0064\u0065\u0074\u0061\u0069\u006C\u0073 = \u006E\u0065\u0077 \u0053\u0079\u0073\u0074\u0065\u006D.\u0043\u006F\u006C\u006C\u0065\u0063\u0074\u0069\u006F\u006E\u0073.\u0047\u0065\u006E\u0065\u0072\u0069\u0063.\u004C\u0069\u0073\u0074<\u0070\u006C\u0075\u0067\u0069\u006E\u0069\u006E\u0066\u006F>();\u0070\u0075\u0062\u006C\u0069\u0063 \u0048\u0061\u006E\u0064\u006C\u0065\u0050\u006C\u0075\u0067\u0069\u006E\u0073(){\u0073\u0065\u0074\u0075\u0070();}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0072\u0069\u006E\u0067 \u006E = "";\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0073\u0065\u0074\u0075\u0070(){\u0069\u0066 (\u0069\u006E\u0073\u0074._\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0055\u0052\u004C\u0073==\u006E\u0075\u006C\u006C || \u0069\u006E\u0073\u0074._\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0055\u0052\u004C\u0073.\u004C\u0065\u006E\u0067\u0074\u0068==0){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0073\u0074\u0072\u0069\u006E\u0067 \u0075\u0072\u006C \u0069\u006E \u0069\u006E\u0073\u0074._\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0055\u0052\u004C\u0073){\u0067\u0065\u0074\u0070\u006C\u0075\u0067\u0069\u006E\u0069\u006E\u0066\u006F(\u0075\u0072\u006C);}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0073\u0068\u0075\u0074\u0064\u006F\u0077\u006E(){\u0069\u0066 (\u004C\u006F\u0061\u0064\u0065\u0064.\u0043\u006F\u0075\u006E\u0074 > 0){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0073\u0074\u0072\u0069\u006E\u0067 \u0066\u0069\u006C\u0065\u006E\u0061\u006D\u0065 \u0069\u006E \u004C\u006F\u0061\u0064\u0065\u0064){\u0053\u0079\u0073\u0074\u0065\u006D.\u0049\u004F.\u0046\u0069\u006C\u0065.\u0044\u0065\u006C\u0065\u0074\u0065(\u0053